// src/components/aboutMe/AboutMe.js

import './AboutMe.style.css'

function AboutMe (){
    return(
        <section className="aboutme-container">
            <img src="/assets/profile.jpg" alt="Foto do Lucas" className="profile-picture"/>
            <div className="aboutme-content">
                <h2>Sobre Mim!</h2>
                <p>Oi, eu sou o Lucas Fanha Felix! Tenho experiência em logística, estou me formando em Análise e Desenvolvimento de Sistemas, e sou apaixonado por programação, especialmente por criar projetos em React. Estou constantemente aprendendo e desenvolvendo novas habilidades em tecnologia.</p>
            </div>
        </section>
    );
}

export default AboutMe;
